            Self::ArcStr(arc_str) => arc_str.is_empty(),
            Self::ArcString(arc_string) => arc_string.is_empty(),
            Self::StaticStr(s) => s.is_empty(),
            Self::Inline { len, .. } => *len == 0,
        }
    }
}

